import styled from "styled-components";

export function Modal() {
  return <Modalbox></Modalbox>;
}

const Modalbox = styled.article`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 300px;
  height: 200px;
  z-index: 1000;
  background: #ffffff;
  &::after {
    content: "";
    width: 100vw;
    height: 100vh;
    background-color: rgba(0, 0, 0, 0.2);
  }
`;
